import React from 'react';
import ReactDOM from 'react-dom';

function Tracking() {
  return (
    // Contenido del componente Seguimiento
    <div>
      <h1>Seguimiento Component</h1>
    </div>
  );
}

export default Tracking

ReactDOM.render(<Tracking/>, document.getElementById('rootSeguimiento'));
